(1232, 'options_ft_vidoco_su_menh', 'Được thành lập chính thức vào tháng 7 năm 2017 và có trụ sở tại Hồ Chí Minh. Sứ mệnh của chúng tôi là cung cấp các giải pháp kinh doanh trực tuyến thiết thực cho khách hàng dựa trên đội ngũ nhân sự chuyên nghiệp, không ngừng học hỏi và sáng tạo. Vidoco cũng là một doanh nghiệp có trách nhiệm xã hội cung cấp các cơ hội đào tạo và việc làm cho những người có hoàn cảnh khó khăn ở Việt Nam. Chúng tôi luôn dành hơn 51% lợi nhuận của mình để phục vụ cộng đồng người yếu thế.', 'no'),
